import style from "./findcoder.module.css"
const Menu=()=>{
    return(
        <div id={style.menublock}>
            
            <a href="/explore">Explore Work</a>
            <a href="hire">Hire Talents</a>
            <a href="#dev">Dev board</a>
            <a href="#challenges">Challenges</a>
        </div>
    )
}
export default Menu
